import React from 'react';

const DoubleArray = () => {
    const numbers = [1, 2, 3, 4, 5];
    const doubleNums = numbers.map((number) => number * 2);

    // return
    return (
        <div>
            <h2>Doubled Numbers</h2>
            <ul>
                {doubleNums.map((num, index) => (
                    <li key = {index} > {num} </li>
                ))}
            </ul>
        </div>
    );
};
export default DoubleArray;
